import React from 'react';

const SuccessPage = () => {
  return (
    <div className="success-page">
      <h1>Success!</h1>
      <p>Your car rescue booking was successful.</p>
      <p><strong>Note:</strong> This is only a booking, the payment for the services will be negotiated directly on-site, and charges will be agreed upon before it is undertaken.</p>
    </div>
  );
};

export default SuccessPage;
